{"0": ["Интересные милые сережки. Смущает, что проба как будто накарябана и еле заметна. Обычно проба четко вдавлена. Надеюсь, эти серьги точно из 100% золота.", "2019-07-14T12:36:27.655947827Z", "золотистый", "0", 4, 3, 5, "Серьги", "SOKOLOV"], "2": ["ОЧЕНЬ КРАСИВЫЕ И УДОБНЫЕ СЕРЕЖКИ. РЕБЕНОК ИХ НЕ ЧУВСТВУЕТ И НЕ ЦЕПЛЯЮТСЯ ЗА ОДЕЖДУ. МЕРИЛА НА СЕБЯ, ЗАСТЕГИВАЮТСЯ ХОРОШО", "2019-06-28T11:52:22.276300756Z", "золотистый", "0", 1, 0, 5, "Серьги", "SOKOLOV"], "3": ["Долго следила за этими серёжками для дочки и дождалась скидки.Взяла.На возраст 2 года подходят идеально.У предыдущих серёжек с аналогичным замочком оказалось качество куда лучше:замочек крепче,а само изделие не такое...тонкое что ли...Но зато вишенки смотрятся интересно,надеюсь,что замочек не подведёт.", "2019-05-26T10:53:32.54689176Z", "золотистый", "0", 1, 1, 5, "Серьги", "SOKOLOV"], "4": ["Застежка на одной серьге сломана. Обидно, очень ждали серёжки. Прошу не снимать %.", "2019-01-24T12:30:33.328498962Z", "золотистый", "0", 1, 0, 1, "Серьги", "SOKOLOV"], "6": ["Очень миленькие.", "2019-01-07T11:01:17.721300575Z", "золотистый", "0", 3, 0, 5, "Серьги", "SOKOLOV"], "7": ["Сережки интересные для дошкольного возраста. Замок неплохо защелкивается. Сами вишенки тонковаты,могут погнутся.  Отказ в пользу ананасиков в них замок потолще. Внешне смотрятся красиво.", "2018-11-13T18:12:14.725601598Z", "золотистый", "0", 6, 0, 4, "Серьги", "SOKOLOV"], "8": ["Слишком маленькие сережки, максимум для ребенка 2 лет наверное, так как моей дочке на 3 года они слишком малы: врезаются в мочки и несуразно смотрятся! Вес 1,13гр. ОТКАЗ!", "2017-07-27T08:16:33+03:00", "золотистый", "0", 5, 1, 3, "Серьги", "SOKOLOV"], "9": ["Сережки тонюсенькие, крохотные, для грудничков. На мочке девочки 4,5 лет сидит туго, врезается в кожу.", "2017-06-19T16:56:03+03:00", "золотистый", "0", 8, 1, 3, "Серьги", "SOKOLOV"], "10": ["Замочки и правда очень слабенькие, легко расстегиваются, если случайно задеть.", "2017-06-19T16:57:31+03:00", "золотистый", "0", 3, 0, 3, "Серьги", "SOKOLOV"], "11": ["Сережки очень понравились, но одна не застегивается, попробую снова заказать.", "2017-02-25T14:43:36+03:00", "золотистый", "0", 3, 0, 4, "Серьги", "SOKOLOV"], "12": ["Серьги идеальны для ребёнка, гладкие, нигде ничего не зацепится. Застёжка качественная, вес изделия 1,05 гр. эмаль яркая. Мне очень понравились. Советую", "2017-02-18T19:41:48+03:00", "золотистый", "0", 5, 1, 5, "Серьги", "SOKOLOV"], "13": ["Прекрасные маленькие серьги для девочки,сделаны качественно,нет острых углов,вес 1,5грамм", "2017-02-10T19:32:57+03:00", "золотистый", "0", 6, 1, 5, "Серьги", "SOKOLOV"], "14": ["ПОЧЕМУ ТАК??? Оба замочка на сережках не работают!! я не мастер и не могу починить за пару секунд и зачем покупать товар, который \"не работает\"! Уважаемый WB не надо такое привозить нам(((( прошу не учитывать в % выкупа.", "2017-01-20T00:29:50+03:00", "золотистый", "0", 3, 0, 1, "Серьги", "SOKOLOV"]}
